import React from 'react';
import './Projects.css';
import ProjectItem from './ProjectItem';
import { Container, Col, Row, Form } from "react-bootstrap";

function Projects() {
    return (
        <div className='projects-container'>
            <div className='projects__text'>
                <h1> PROJECTS </h1>
                <p>Posiadamy dwa projekty </p>
            </div>
            <ul className='projects-wrapper'>
                <li className='projects__house'>
                    <ProjectItem
                        src='images/home.jpg'
                        title='H1 GLAZED'
                        // path='/services'
                        text1='35m2'
                        text2='all-season'
                        text3='6 persons'
                        text4='bedroom, bathroom, kitchen, living room'
                    />
                </li>
                <li className='projects__house'>
                    <ProjectItem
                        src='images/img-9.jpg'
                        title='H2 COMFY'
                        // path='/services'
                        text1='35m2'
                        text2='all-season'
                        text3='6 persons'
                        text4='bedroom, bathroom, kitchen, living room'
                    />
                </li>
            </ul>
        </div>
    );
}

export default Projects;
